import { Button } from "bootstrap";
import { Card } from "react-bootstrap";
import styles from "../components/UI/Login.module.css";

const Login = (props) => {
  return (
    <Card>

        <Button type="submit">Login</Button>
    </Card>
  );
};

export default Login;
